  JWARREN, Peter Cory and AITKEN, Penny
  WARREN, Peter Cory and AITKEN, Penny (cont...).
  Pukerangi
  "Pukerangi" was originally part of the 5,225-acre "Waipari" Station which was farmed as a partnership
  between Alwyn and Greville Warren and their children until 1966. In the division of family interests,
  Alwyn's family took 3,200 acres which continued to be known as "Waipari" whilst Peter and his brother
  Roger (who was living in Auckland at that time) were partners in "Pukerangi". Eldest brother Geoffrey
  took over "Penlee" Station at the same time. Peter and Mary Warren went to live on "Pukerangi" in 1959
  when a 12 mile drive was put in and a cottage constructed. The property was developed by extensive
  regrassing and fencing. Peter purchased his brother, Roger's interest in 1979 and sold the property in
  1990.
  02> WARREN, Alwyn Keith m on 03.10.1929 to LAWS, Doreen Eda
  b 23.09.1900 d 27.05.1988
  b 02.04.1901 d 22.08.1983
  Alwyn b. at Wellington and m. at Holy Trinity Church, Sloane Street, London.
  Alwyn was educated at Marlborough College, Magdalen College, Oxford (MA) and
  Cuddesdon Theological College. He was Vicar of Ross and South Westland, Waimate
  and Merivale, Archdeacon and Dean of Christchurch, Fourth Bishop of Christchurch
  (1951-66), Member of the Central Committee of the World Council of Churches,
  Sub-Prelate of the Order of St John and Chancellor of the University of
  Canterbury. He was also Chaplain to the 2nd New Zealand Expeditionary Force (NZ Divisional Cavalry) in
  1944-45. His honours and awards included the CMG and MC.
  Doreen was Diocesan President of the Mothers' Union and Delegate to the First Assembly of the World Council
  of Churches (1948). In 1947 she gained the University of London's Certificate of Proficiency in Religious
  Knowledge. With Alwyn, she was instrumental in founding the Marriage Guidance Movement. In 1950 she wrote
  a little book entitled "Some Canterbury Churches".
  01> WARREN, Jennifer Anketell m on 16.12.1966 to CARGILL THOMPSON, William
  Williams
  David James
  b 16.09.1931
  b 17.12.1930 d 21.02.1978
  Jennifer b. at Christchurch and m, at London, England. James, s/o William David Cargill Thompson and H
  MS (Mollie) Reed, b. at Rangoon, Burma. Address: 15 Rochester Road, Kentish Town, London NW1 9JH,
  England.
  Jennifer graduated BA(NZ) and MA(Oxon) and was a Special Assistant in the Department of Coins and
  Medals at the British Museum. She has produced publications on the coinage of ancient Greece.
  James graduated MA, PhD(Cantab). He was a Fellow and Lay Dean of King's College, Cambridge, Professor
  of Ecclesiastical History at King's College, London, and Governor of Harrow School. He was the author
  of books and other publications on Luther and the Reformation.
  01> CARGILL THOMPSON, Alexander Martin Williams
  b 20.03.1969
  Alexander b. at Brighton, England. He read Natural Sciences (Chemistry) at Robinson
  College, Cambridge, graduating BA in 1990 and MA and PhD(Cantab) in 1993. He has
  over forty papers published in chemical journals and currently works as a research
  scientist. He was a Cambridge Half-Blue in Rifle Shooting and has shot for England
  three times in the Elcho National Match Rifle Match at Bisley.
